syntax = "proto3";

package io.seata.protocol.protobuf;

import "AbstractTransactionResponse.proto";


option java_multiple_files = true;
option java_outer_classname = "BranchRegisterResponse";
option java_package = "io.seata.protocol.core.protobuf";

// PublishRequest is a publish request.
message BranchRegisterResponse {
    AbstractTransactionResponse abstractTransactionResponse = 1;
    int64 branchId = 2;
}